import React from "react";

export default (props) => {
    let arr = []
    
    return (
        <tbody>
        {props.rows.map(()=> (
                <tr>
                    <td>1</td>
                </tr>
            )
        )}
        <tr><td>2</td></tr>
        </tbody>
    )

}
